Instrumenting GraphQL
Getting Started
Usage example
Using
```
useInngest
```
just requires that you have an Inngest client (see the
[Quick start](\docs\getting-started\nextjs-quick-start)
) set up with an appropriate event key (see
[Creating an event key](https://www.inngest.com/docs/events/creating-an-event-key)
).
Here's a single-file example of how to add the plugin.
Copy Copied
```
import { useInngest } from "envelop-plugin-inngest" ;
import { createSchema , createYoga } from "graphql-yoga" ;
import { Inngest } from "inngest" ;

const inngest = new Inngest ({ id : "my-app" });

// Provide your schema
const yoga = createYoga ({
schema : createSchema ({
typeDefs : /* GraphQL */ `
type Query {
greetings: String!
}
` ,
resolvers : {
Query : {
greetings : () => "Hello World!" ,
} ,
} ,
}) ,

// Add the plugin to the server. RedwoodJS users can use the
// `extraPlugins` option instead.
plugins : [ useInngest ({ inngestClient : inngest })] ,
});

// Start the server and explore http://localhost:4000/graphql
const server = createServer (yoga);

server .listen ( 4000 , () => {
console .info ( "Server is running on http://localhost:4000/graphql" );
});
```

Instrumenting GraphQL
Getting Started
Output events
Once the plugin is installed, an event will be sent for all successful GraphQL operations, resulting in a ready-to-use set of events that you can react to immediately.
Here's an example event sent from a mutation to create a new item in a user's cart:
Copy Copied
```
{
"name" : "graphql/create-cart-item.mutation" ,
"data" : {
"identifiers" : [
{
"id" : 27 ,
"typename" : "CartItem"
}
] ,
"operation" : {
"id" : "create-cart-item" ,
"name" : "CreateCartItem" ,
"type" : "mutation"
} ,
"result" : {
"data" : {
"createCartItem" : {
"id" : 27 ,
"productId" : "123"
}
}
} ,
"types" : [
"CartItem"
] ,
"variables" : {}
} ,
"id" : "01GXXAQ1M0A1SFVGEHACRF4K1C"
}
```
